import Axios from 'axios'

export default class Exercise{

    async get(){
        return await Axios.get('http://localhost:5000/exercises')
    }

    async show(id){
        return await Axios.get('http://localhost:5000/exercises/' + id)
    }

    async destroy(id){
        return await Axios.delete('http://localhost:5000/exercises/' + id)
    }

    async update(id, data){
        return await Axios.put('http://localhost:5000/exercises/' + id, data)
    }

    async store(data){
        return await Axios.post('http://localhost:5000/exercises/', data)
    }

}
